import React, { Component } from 'react';
import './List.css'

class List extends Component {

  constructor(props){
    super(props)

  }

  render(){
    return(
      <div className="List">
        {this.props.items.map(item =>
          <div>
            {item.label}
          </div>
        )}
      </div>
    )
  }
}

export default List;
